export default function menu() {
    return (
      <View
        style={{
          backgroundColor: 'green',
        }}
      >
        <div id="menu">
          <a href="#news">News</a>
          <a href="#contact">Contact</a>
          <a href="#about">About</a>
        </div>
      </View>,
      <View>
        <a href='#' onClick={Menu}>
          menubutton
          </a>
      </View>
    );
  }
